import React from "react";
import {BrowserRouter, Routes, Route} from "react-router-dom"

import StyleNavbar from "./components/StyleNavbar";

function App() {
  return (
    <BrowserRouter>
      <nav>
        <StyleNavbar/>
      </nav>
      <Routes>
        <Route path="/" element={<div>Home page</div>} />

      </Routes>

    </BrowserRouter>

  );
}

export default App;
